INSERT INTO `offers` (`name`, `description`, `image_path`, `price`, `period`, `isMain`, `isShow`)
VALUES
("Традиционная<br\>стрижка", "Эта классическая традиционная услуга идеально подходит,<br/>если вы хотите, чтобы ваши волосы были подстрижены правильно.<br/>Наши парикмахеры будут рады помочь вам с этим.<br/>Мытьё волос. Стрижка машинкой. Укладка волос.", "/upload/admin/service/traditional-haircut.png", 25, 25, 1, 1),
("Бритьё<br\>бороды", "Бритьё бороды - одна из наших самых популярных услуг.<br/>Это необходимость для всех мужчин,<br/>которые хотят иметь бороду, которая выглядит потрясающе.<br/>Распаривание кожного покрова лица. Бритьё шаветкой.", "/upload/admin/service/beard-shave.png", 40, 60, 1, 1),
("Подравнивание<br\>усов", "Усы - это классический выбор мужчин,<br>и они никогда не выйдут из моды надолго.<br>С нами вы можете сохранить свои усы ухоженными.<br/>Подравнивание усов. Укладка.", "/upload/admin/service/mustache-trim.png", 30, 45, 1, 1),
("Подравнивание<br\>бороды", "Все хорошо знаю, что борода придаёт брутальности лицу.<br/>Чтобы ваша борода смотрелась аккуратно,<br/>за ней нужен уход, именно поэтому мы предлагаем данную услугу.<br/>Придание формы бороде шаветкой. Укладка бороды.", "/upload/admin/service/beard-trim.png", 25, 30, 1, 1),
("Рисунок на волосах", "Стрижка волос согласно трафарету.", "/upload/admin/service/hair-draw.png", 55, 90, 0, 1),
("Афрокосички", "Мытьё волос. Заплетание косичек.", "/upload/admin/service/afro-braids.png", 150, 90, 0, 1),
("Покраска бороды", "Мытьё, окрашивание волос бороды.", "/upload/admin/service/beard-paint.png", 45, 75, 0, 1),
("Пробор/Окантовка", "Придание формы причёске.", "/upload/admin/service/part-edge.png", 10, 20, 0, 1),
("Укладка", "Укладка волос.", "/upload/admin/service/styling.png", 10, 15, 0, 1),
("Тонирование бороды", "Мытье, окрашивание, укладка бороды.", "/upload/admin/service/beard-tint.png", 35, 40, 0, 1);
